import { NavLink } from 'react-router-dom';
import logo from './logo.jpg';

const Header = () => {
    return (
        <div class="col-md-12">
        <NavLink to="/"><img src={logo} class="img-logo img-fluid" alt="Logo" /></NavLink>
        <hr></hr>
      </div>
    )
};

export default Header;
